import React from "react";

class Menu extends React.Component{
    constructor(props){
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }
    handleClick(e){
        let text = e.target.value;
        this.props.chooseVideo(text);
    }
    render() {
        return(
            <div>
                <form onClick={this.handleClick}>
                    <input type="radio" value="Nature"/>Nature
                    <input type="radio" value="Sky"/>Sky
                    <input type="radio" value="city"/>City
                </form>
            </div>
        )
    }
}
export default Menu
